// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingContract {
    address public admin;
    string private message = "Hello world!" ;
    mapping(address => bool) private voted;
    mapping(uint256 => uint256) private voteCounts;
    mapping(uint256 => string) public options;
    mapping(uint256 => Candidate) private candidates;
    mapping(uint256 => bool) private candidateExists;

    event Vote(uint256 indexed option, address indexed voter);

    struct Candidate {
        uint256 id;
        string name;
        string party;
        uint256 voteCount;
    }

    constructor() {
       addCandidate(0, "Candidate A", "Party X");
        addCandidate(1, "Candidate B", "Party Y");
        addCandidate(2, "Candidate C", "Party Z");
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }

        function getMessage() public view returns(string memory){
        return message;
    }


    function createVote(string[] memory _options) public onlyAdmin {
        require(_options.length > 0, "Options must be provided");

        for (uint256 i = 0; i < _options.length; i++) {
            options[i] = _options[i];
        }
    }

    function addCandidate(
        uint256 _id,
        string memory _name,
        string memory _party
    ) private {
        require(!candidateExists[_id], "Candidate with the same ID already exists");

        candidates[_id] = Candidate(_id, _name, _party, 0);
        candidateExists[_id] = true;
    }

    function vote(uint256 _option) public {
        require(bytes(options[_option]).length > 0, "Invalid option");
        require(!voted[msg.sender], "You have already voted");

        voted[msg.sender] = true;
        voteCounts[_option]++;

        emit Vote(_option, msg.sender);
    }

    function getCandidate(uint256 _id)
        public
        view
        returns (
            uint256,
            string memory,
            string memory,
            uint256
        )
    {
        require(candidateExists[_id], "Candidate does not exist");

        Candidate memory candidate = candidates[_id];
        return (candidate.id, candidate.name, candidate.party, candidate.voteCount);
    }

    function getVoteCount(uint256 _option) public view returns (uint256) {
        require(bytes(options[_option]).length > 0, "Invalid option");

        return voteCounts[_option];
    }

    function getVoting() public view returns (uint256[] memory, Candidate[] memory) {
    uint256 optionCount = getOptionCount();
    uint256[] memory allVoteCounts = new uint256[](optionCount);
    Candidate[] memory allCandidates = new Candidate[](candidateCount());

    for (uint256 i = 0; i < optionCount; i++) {
        allVoteCounts[i] = voteCounts[i];
    }

    for (uint256 i = 0; i < candidateCount(); i++) {
        allCandidates[i] = candidates[i];
    }

    return (allVoteCounts, allCandidates);
}

function candidateCount() public view returns (uint256) {
    uint256 count = 0;
    for (uint256 i = 0; i < 3; i++) { // Sesuaikan dengan jumlah kandidat yang telah ditambahkan
        if (bytes(options[i]).length > 0) {
            count++;
        }
    }
    return count;
}

function getOptionCount() public view returns (uint256) {
    uint256 count = 0;

    for (uint256 i = 0; i < candidateCount(); i++) {
        if (bytes(options[i]).length > 0) {
            count++;
        }
    }

    return count;
}
}
